import React, { useState } from 'react';
import { Range } from 'react-range';

const TimelineSlider: React.FC<{ videoDuration: number, onTrimChange: (start: number, end: number) => void }> = ({ videoDuration, onTrimChange }) => {
  const [values, setValues] = useState([0, videoDuration]);

  const handleChange = (newValues: number[]) => {
    setValues(newValues);
    onTrimChange(newValues[0], newValues[1]);
  };

  return (
    <div className="timeline-slider">
      <Range
        step={0.1}
        min={0}
        max={videoDuration}
        values={values}
        onChange={handleChange}
        renderTrack={({ props, children }) => (
          <div
            {...props}
            style={{
              height: '6px',
              width: '100%',
              background: '#ddd'
            }}
          >
            {children}
          </div>
        )}
        renderThumb={({ props }) => (
          <div
            {...props}
            style={{
              height: '20px',
              width: '20px',
              backgroundColor: '#999'
            }}
          />
        )}
      />
    </div>
  );
};

export default TimelineSlider;
